import { Routes, Route, Link } from "react-router-dom";
import Navbar from './layouts/Navbar';
import Layout from './layouts/Layout';



function App() {
  return (
      <Routes>
          <Route path="/" element={<Layout />}>
          <Route path="navbar" element={<Navbar />} />
        </Route>
      </Routes>
  );
}



export default App;
